import React from 'react';
import type { NextPage } from "next";
import { Row, Col } from 'antd';

const Home: NextPage = () => {
  return(
  <div>
     <Row gutter={8}>
      {/* xs:mobile, sm: tablet, md: 작은 데스크탑 */}
        <Col xs={24}></Col> 
      </Row>
  </div>
  )
}

export default Home;
